import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the gaming server icon to be visible
    await page.waitForSelector('.server-item[data-server="gaming"]');

    // Click on the gaming server icon to switch servers
    await page.click('.server-item[data-server="gaming"]');

    // Wait for the channel list to load after switching servers
    await page.waitForSelector('.channel-list');

    // Take a screenshot after switching to the gaming server
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_switch.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_switch.png'));

    // Extract the current server name to verify the switch
    const currentServerName = await page.$eval('#server-name', el => el.textContent);

    return {
      success: true,
      action: "Switched to Gaming Server",
      extractedData: { currentServerName },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

